a.put("app/manage/templates/manageConnection.html",'\x3c!--\nCopyright 2014 Glyptodon LLC.\n\nPermission is hereby granted, free of charge, to any person obtaining a copy\nof this software and associated documentation files (the "Software"), to deal\nin the Software without restriction, including without limitation the rights\nto use, copy, modify, merge, publish, distribute, sublicense, and/or sell\ncopies of the Software, and to permit persons to whom the Software is\nfurnished to do so, subject to the following conditions:\n\nThe above copyright notice and this permission notice shall be included in\nall copies or substantial portions of the Software.\n\nTHE SOFTWARE IS PROVIDED "AS IS", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\nIMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY,\nFITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE\nAUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER\nLIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM,\nOUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN\nTHE SOFTWARE.\n--\x3e\n\n\x3cdiv class\x3d"view" ng-class\x3d"{loading: !isLoaded()}"\x3e\n\n    \x3c!-- Main property editor --\x3e\n    \x3cdiv class\x3d"header"\x3e\n        \x3ch2\x3e{{\'MANAGE_CONNECTION.SECTION_HEADER_EDIT_CONNECTION\' | translate}}\x3c/h2\x3e\n        \x3cguac-user-menu\x3e\x3c/guac-user-menu\x3e\n    \x3c/div\x3e\n    \x3cdiv class\x3d"section"\x3e\n        \x3ctable class\x3d"properties"\x3e\n            \n            \x3c!-- Edit connection name --\x3e\n            \x3ctr\x3e\n                \x3cth\x3e{{\'MANAGE_CONNECTION.FIELD_HEADER_NAME\' | translate}}\x3c/th\x3e\n              \n                \x3ctd\x3e\x3cinput type\x3d"text" ng-model\x3d"connection.name" autocorrect\x3d"off" autocapitalize\x3d"off"/\x3e\x3c/td\x3e\n            \x3c/tr\x3e\n            \n            \x3c!-- Edit connection location --\x3e\n            \x3ctr\x3e\n                \x3cth\x3e{{\'MANAGE_CONNECTION.FIELD_HEADER_LOCATION\' | translate}}\x3c/th\x3e\n              \n                \x3ctd\x3e\n                    \x3clocation-chooser\n                        data-data-source\x3d"selectedDataSource" root-group\x3d"rootGroup"\n                        value\x3d"connection.parentIdentifier"\x3e\x3c/location-chooser\x3e\n                \x3c/td\x3e\n            \x3c/tr\x3e\n            \n            \n            \x3c!-- Edit connection protocol --\x3e\n            \x3ctr\x3e\n                \x3cth\x3e{{\'MANAGE_CONNECTION.FIELD_HEADER_PROTOCOL\' | translate}}\x3c/th\x3e\n                \x3ctd\x3e\n                    \x3cselect ng-model\x3d"connection.protocol" ng-options\x3d"name as getProtocolName(protocol.name) | translate for (name, protocol) in protocols | orderBy: name"\x3e\x3c/select\x3e\n                \x3c/td\x3e\n            \x3c/tr\x3e\n        \x3c/table\x3e\n    \x3c/div\x3e\n\n    \x3c!-- Connection attributes section --\x3e\n    \x3cdiv class\x3d"attributes"\x3e\n        \x3cguac-form namespace\x3d"\'CONNECTION_ATTRIBUTES\'" content\x3d"attributes" model\x3d"connection.attributes"\x3e\x3c/guac-form\x3e\n    \x3c/div\x3e\n\n    \x3c!-- Connection parameters --\x3e\n    \x3ch2 class\x3d"header"\x3e{{\'MANAGE_CONNECTION.SECTION_HEADER_PARAMETERS\' | translate}}\x3c/h2\x3e\n    \x3cdiv class\x3d"section connection-parameters" ng-class\x3d"{loading: !parameters}"\x3e\n        \x3cguac-form namespace\x3d"getNamespace(connection.protocol)"\n                   content\x3d"protocols[connection.protocol].forms"\n                   model\x3d"parameters"\x3e\x3c/guac-form\x3e\n    \x3c/div\x3e\n\n    \x3c!-- Form action buttons --\x3e\n    \x3cdiv class\x3d"action-buttons"\x3e\n        \x3cbutton ng-show\x3d"canSaveConnection" ng-click\x3d"saveConnection()"\x3e{{\'MANAGE_CONNECTION.ACTION_SAVE\' | translate}}\x3c/button\x3e\n        \x3cbutton ng-show\x3d"canCloneConnection" ng-click\x3d"cloneConnection()"\x3e{{\'MANAGE_CONNECTION.ACTION_CLONE\' | translate}}\x3c/button\x3e\n        \x3cbutton ng-click\x3d"cancel()"\x3e{{\'MANAGE_CONNECTION.ACTION_CANCEL\' | translate}}\x3c/button\x3e\n        \x3cbutton ng-show\x3d"canDeleteConnection" ng-click\x3d"deleteConnection()" class\x3d"danger"\x3e{{\'MANAGE_CONNECTION.ACTION_DELETE\' | translate}}\x3c/button\x3e\n    \x3c/div\x3e\n\n    \x3c!-- Connection history --\x3e\n    \x3ch2 class\x3d"header"\x3e{{\'MANAGE_CONNECTION.SECTION_HEADER_HISTORY\' | translate}}\x3c/h2\x3e\n    \x3cdiv class\x3d"history section" ng-class\x3d"{loading: !historyEntryWrappers}"\x3e\n        \x3cp ng-hide\x3d"historyEntryWrappers.length"\x3e{{\'MANAGE_CONNECTION.INFO_CONNECTION_NOT_USED\' | translate}}\x3c/p\x3e\n\n        \x3c!-- History list --\x3e\n        \x3ctable ng-show\x3d"historyEntryWrappers.length"\x3e\n            \x3cthead\x3e\n                \x3ctr\x3e\n                    \x3cth\x3e{{\'MANAGE_CONNECTION.TABLE_HEADER_HISTORY_USERNAME\' | translate}}\x3c/th\x3e\n                    \x3cth\x3e{{\'MANAGE_CONNECTION.TABLE_HEADER_HISTORY_START\' | translate}}\x3c/th\x3e\n                    \x3cth\x3e{{\'MANAGE_CONNECTION.TABLE_HEADER_HISTORY_DURATION\' | translate}}\x3c/th\x3e\n                \x3c/tr\x3e\n            \x3c/thead\x3e\n            \x3ctbody\x3e\n                \x3ctr ng-repeat\x3d"wrapper in wrapperPage"\x3e\n                    \x3ctd class\x3d"username"\x3e{{wrapper.entry.username}}\x3c/td\x3e\n                    \x3ctd class\x3d"start"\x3e{{wrapper.entry.startDate | date:historyDateFormat}}\x3c/td\x3e\n                    \x3ctd class\x3d"duration"\n                        translate\x3d"{{wrapper.durationText}}"\n                        translate-values\x3d"{VALUE: wrapper.duration.value, UNIT: wrapper.duration.unit}"\x3e\x3c/td\x3e\n                \x3c/tr\x3e\n            \x3c/tbody\x3e\n        \x3c/table\x3e\n\n        \x3c!-- Pager controls for history list --\x3e\n        \x3cguac-pager page\x3d"wrapperPage" items\x3d"historyEntryWrappers"\x3e\x3c/guac-pager\x3e\n\n    \x3c/div\x3e\n\n\x3c/div\x3e');
